import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Typography } from '@mui/material';

const CustomTableCell = (props) => (
  <TableCell align="center" {...props} />
);

const App = () => {
  // Create an array for rows
  const rows = new Array(40).fill(null).map((_, index) => ({
    id: index,
    grid: '',
    diode: ``,
    // unmask: index % 2 === 0 ? 'Unmask' : '',
    unmask: '',
    ru: `${index}`,
    //seatUuid: `UUID-${index + 1}`,

    ru2: `${index + 40}`,
    unmask2: '',
    diode2: ``,
    grid2: '',
  }));

  return (
    <TableContainer component={Paper}>
      <Typography variant="h6" align="center" style={{ padding: 16 }}>
        TAPE-IN DB VIEW
      </Typography>
      <Table aria-label="custom table">
        <TableHead>
          <TableRow>
            <CustomTableCell>Grid</CustomTableCell>
            <CustomTableCell>Diode</CustomTableCell>
            <CustomTableCell>Unmask</CustomTableCell>
            <CustomTableCell>RU</CustomTableCell>
            <CustomTableCell>Seat UUID</CustomTableCell>
            <CustomTableCell>RU</CustomTableCell>
            <CustomTableCell>Unmask</CustomTableCell>
            <CustomTableCell>Diode</CustomTableCell>
            <CustomTableCell>Grid</CustomTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row, index) => (
            <>
              {index === 20 && (
                <TableRow key="midhalf">
                  <CustomTableCell colSpan={9}>MIDHALF</CustomTableCell>
                </TableRow>
              )}
              <TableRow key={row.id}>
                <CustomTableCell>{row.grid}</CustomTableCell>
                <CustomTableCell>{row.diode}</CustomTableCell>
                <CustomTableCell>{row.unmask}</CustomTableCell>
                <CustomTableCell>{row.ru}</CustomTableCell>
                {/* Duplicate the cells to simulate the layout in the image */}
                <CustomTableCell>{row.seatUuid}</CustomTableCell>
                <CustomTableCell>{row.ru2}</CustomTableCell>
                <CustomTableCell>{row.unmask}</CustomTableCell>
                <CustomTableCell>{row.diode}</CustomTableCell>
                <CustomTableCell>{row.grid}</CustomTableCell>
              </TableRow>
            </>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default App;
